  const sortedCountryNames = [...allCountryScores].sort((a,b) => a.name.localeCompare(b))
  return (
    <div className="App">
    <h1 className="heading">High Scores per Country</h1>
      {allCountryScores.map((country, index) => (
        <HighScoreTable key={index} country={country} />
      ))}
    </div>
  );
}

export default App;
